import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import TopBar from './components/TopBar'
import Navbar from './components/Navbar'
import Advantage from './components/Advantage';

function App() {
  return (
    <div className="App">
      <TopBar />
      <Navbar />
      <Advantage />
    </div>
  );
}

export default App;
